import React, { useState, useEffect } from 'react';
import { Box } from '../../styles/main/MainStyles';

export default function PickupTile({ color, remove, onMouseLeave, onClick }) {
  const [hover, setHover] = useState();
  const [final, setFinal] = useState(false);

  useEffect(() => {
    setFinal(false)
  }, [remove])

  if (remove && hover || final) {
    return (
      <Box 
        onClick={() => setFinal(true)}
        onMouseLeave={() => setHover(false)}
        w="50px" h="50px" br="10px" bg="#999999" ml="5px" 
      />
    )
  }
  
  return (
    <svg
      onMouseEnter={() => remove && setHover(true)}
      onMouseLeave={onMouseLeave}
      onClick={onClick}
      style={{ marginLeft: 5 }}
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      width="50"
      height="50"
      fill="none"
      viewBox="0 0 50 50"
    >
      <rect width="50" height="50" fill={color || "#999999"} rx="10"></rect>
      <path fill="url(#pattern0)" d="M5 5H45V45H5z"></path>
      <defs>
        <pattern
          id="pattern0"
          width="1"
          height="1"
          patternContentUnits="objectBoundingBox"
        >
          <use transform="scale(.00098)" xlinkHref="#image0"></use>
        </pattern>
        <image
          id="image0"
          width="1024"
          height="1024"
          href="data:image/png;base64,"
        ></image>
      </defs>
    </svg>
  );
}